switch (msg.topic) {
    case "pos1":
        return {
            topic: 'pos1',
            payload: Math.round(msg.payload * 240 / 100)
        };
    case "pos2":
        return {
            topic: 'pos2',
            payload: Math.round(msg.payload * 240 / 100)
        };
    case "vertical":
        return {
            topic: 'vertical',
            payload: msg.payload
        };
    default:
        break;
}

return {
    topic: 'config',
    payload: {
        k: msg.topic,
        v: msg.payload
    }
};

// 获取输入的payload
let payload = msg.payload;

if (!Array.isArray(msg.payload)) {
    return null;
}
// 初始化计数器
let countObject0 = 0;
let countObject2 = 0;

// 遍历每个检测到的对象
for (let i = 0; i < payload.length; i++) {
    let obj = payload[i];
    let confidence = obj[4];
    let objectId = obj[5];

    // 检查并生成符合条件的对象0的消息
    if (objectId === 0 && confidence > 70) {
        countObject0++;
        // 创建输出消息
        let newMsg = {
            topic: "0",
            payload: countObject0
        };
        // 发送消息
        node.send(newMsg);
    }

    // 检查并生成符合条件的对象2的消息
    if (objectId === 2 && confidence > 80) {
        countObject2++;
        // 创建输出消息
        let newMsg = {
            topic: "2",
            payload: countObject2
        };
        // 发送消息
        node.send(newMsg);
    }
}

// 结束函数，不返回任何消息，因为消息已经通过node.send发送
return null;
